import com.eviware.soapui.support.XmlHolder
import com.eviware.*
import com.eviware.soapui.model.testsuite.TestRunner.Status
import jxl.*
filepath = "C:/Manasa/API Testing Training/Project/Test Data.xls"
File Excel = new File(filepath)
//excel contain workbooks and workbok contains sheets
Workbook wb = Workbook.getWorkbook(Excel)
//trying to fetch the sheet
Sheet sh = wb.getSheet("Sheet1")
//log.info sh.getCell(0,0).getContents()
rowSize = sh.getRows().toInteger();
columnSize = sh.getColumns().toInteger();
log.info "The total number of rows which contains data are" +rowSize
log.info "The total number of columns which contains data are" +columnSize
//for loop
for(def i=0;i<rowSize;i++)
{
    for(def j=0;j<columnSize;j++)
    {
    	if(j==0)
    	{
        email = sh.getCell(j,i).getContents()
       }

      else if(j==1)
       {
       	 firstname = sh.getCell(j,i).getContents()
       }
       else if(j==2)
       {
       	lastname = sh.getCell(j,i).getContents()
       }
    }  
}
def tc = testRunner.testCase.testSuite.project.testSuites["Customer_CustomerID"].testCases["Property_Transfer_Expansion_ScriptAssertion"]
//to update my property file with username and password
tc.testSteps["Customer_Details"].setPropertyValue("email",email)
tc.testSteps["Customer_Details"].setPropertyValue("firstname",firstname)
tc.testSteps["Customer_Details"].setPropertyValue("lastname",lastname)
//run synchrouously
def runner = tc.run(null,false)
//Status of my test Case result
//status and timetaken
log.info "Status:  $runner.status, time taken for testCase is: $runner.timeTaken ms"
//number of test steps executed
log.info "number of test steps executed are: " +runner.results.size();
//assert
//assert runner.results.size()==5
//reason if this fails
assert runner.status != Status.FAILED : runner.reason

