import com.eviware.soapui.support.XmlHolder

//To retrieve the response from Call Login Service

//Context is used only for that specific testcase
def response = context.testCase.getTestStepByName("Add New Customer").getPropertyValue("Response")
//Since i am inside  teststep if i want to fetch the response of the step then i can use message exchange
//def sessionid = messageExchange.response.responseContent
//log.info sessionid

def holder = new XmlHolder(response)
def id=holder.getNodeValue("//*:id")
log.info id

//This is basically to store my response node Element in the property of my testcase
context.testCase.setPropertyValue("id",id)
